import React from 'react'
import './cards.css'
import { CardsData } from '../Data/Data'
import { Card } from '@material-ui/core'


const Cards = () => {
  return (
    <div className="Cards">
        {CardsData.map((card, id) => {
            return(
                <div className="parentContainer"  key={id}>
                    <Card
                        title={card.titile}
                        icon={card.icon}
                        count={card.count}
                        trendIcon={card.trendIcon}
                        per={card.per}
                    />
                </div>
            )
        })}
    </div>
  )
}

export default Cards
